        PERS wobjdata wobj_Palette:=[FALSE,TRUE,"",[[-701.200489371,303.066515226,114.117418405],[0.006407291,-0.380247924,-0.924858642,-0.002637288]],[[0,0,0],[1,0,0,0]]];


